import React from 'react';
import './Profile.css'; // Your CSS file to style the components

import AppBar from '@mui/material/AppBar';
import Box from '@mui/material/Box';
import Toolbar from '@mui/material/Toolbar';
import Typography from '@mui/material/Typography';
import Button from '@mui/material/Button';
import IconButton from '@mui/material/IconButton';
import ArrowBackIosIcon from '@mui/icons-material/ArrowBackIos';
import MenuIcon from '@mui/icons-material/Menu';
import { useNavigate } from 'react-router-dom';

const Profile = () => {
    // Replace these with your actual user data
    const user = {
        name: 'John Doe',
        username: 'johndoe123',
        bio: 'Frontend Developer | UI/UX Enthusiast',
        location: 'City, Country',
        avatar: 'https://example.com/avatar.jpg',
        followers: 1500,
        following: 120,
    };

    const navigate = useNavigate();

    return (
        <div className="profile-container">
            <AppBar position="static">
                <Toolbar>
                    
                    <ArrowBackIosIcon onClick={() => navigate(-1)} />
                    
                    
                    {/* <IconButton
              size="large"
              edge="start"
              color="inherit"
              aria-label="menu"
              sx={{ mr: 2 }}
            > */}
              {/* <MenuIcon />
            </IconButton> */}
                    <Typography variant="h6"  component="div" sx={{ flexGrow: 1, textAlign:"center" }}>
                        My Profile
                    </Typography>
                    
                    <Button color="inherit" style={{width:"100px"}}>Logout</Button>
                </Toolbar>
            </AppBar>
            <div>

            </div>
           
           
            {/* Add more sections like user posts, photos, etc. */}
        </div>
    );
};

export default Profile;
